import React from 'react';
import logo from './logo.svg';
import './App.css';
import Customenr from './components/Customer'

const customer = {
  'id': 1,
  'image' : 'https://placeimg.com/64/64/any',
  'name' : '정종학',
  'birthday' : '891102',
  'gender' : '남자',
  'job' : 'nop',
}
function App() {
  return (
    <Customenr 
      name = {customer.name}
      birthday = {customer.birthday}
      gender = {customer.gender}
      job = {customer.job}
    />
  );
}

export default App;
